import AppAlbum from './AppAlbum';
import AppProfile from './AppProfile';
import './App.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <AppAlbum />
        <AppProfile />
      </header>
    </div>
  );
}

export default App;
